  return (


    <nav class="navbar navbar-expand-md fixed-top navbar-dark bg-dark">
        <div class="container">
          <a href="#home" class="navbar-brand"><i class="bi bi-house"></i></a>

          <button class="navbar-toggler" data-bs-toggle="collapse" data-bs-target="#navbar-collapse">
            <span class="navbar-toggler-icon"></span>
          </button>

          <div id="navbar-collapse" class="collapse navbar-collapse">
            <div class="navbar-nav ms-auto">
              <a href="#meet-target" class="nav-link">Meet Me</a>
              <a href="dist/game.html" class="nav-link">Game</a>
              <a href="https://aymar1400.github.io/Resume2023.pdf" class="nav-link">Resume</a>
            </div>
          </div>
        </div>
      </nav>




  );
}
